import React, { Component } from 'react';
import Search from "./components/search/Search";
import './App.css';
import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';

class App extends Component{
  render(){
    return(
      <MuiThemeProvider>
      <div>
      <Search />
      </div>
      </MuiThemeProvider>
    )
  }
}

export default App;
